import {BrowserRouter as Router, Route, Switch, Link} from 'react-router-dom'

class CookYStories extends Component {
    render() {
        return (
            // <Router>
                // {/* <> */}
                    <HeaderComponent/>
                // {/* </> */}
            // {/* </Router> */}
        );
    }
}

class HeaderComponent extends Component {
    render() {
        return (
            <header>
                <nav className="navbar navbar-expand-md navbar-dark bg-light">
                    <div>
                        <a className="navbar-brand" href="#">
                            <img src="http://placehold.it/150x50?text=Logo" alt=""/>
                        </a>
                    </div>
                    <ul className="navbar-nav">
                        {isLoggedIn && <li><Link className="nav-link" to="/welcome/prathma">Home</Link></li>}
                        {isLoggedIn && <li><Link className="nav-link" to="/todos">Todos</Link></li>}
                    </ul>
                    <ul className="navbar-nav navbar-collapse justify-content-end">
                        {!isLoggedIn && <li><Link className="nav-link" to="/login">Login</Link></li>}
                       {isLoggedIn && <li><Link className="nav-link" to="/logout" onClick={AuthenticationService.logout()
}>Logout</Link></li>}
                    </ul>
                </nav>
            </header>
        );
    }
}

export default CookYStories;
